import { Col, Row } from "react-bootstrap";
import smart1 from "../assets/img/SilvProject/smart1n.png";
import smart2 from "../assets/img/SilvProject/smart2n.png";
import pc1 from "../assets/img/SilvProject/tablet_and_laptop_on_transparent_background.png";
function SilvProject() {
  return (
    <>
      <Row className="d-flex  align-items-center ">
        <h2 className="myTextWhite d-flex fw-bolder justify-content-center ">
          My Projects:
        </h2>
        <h5 className="myTextRed d-flex fw-bolder justify-content-center">
          {" "}
          Ui design{" "}
        </h5>{" "}
        <Col className=" d-flex align-items-center flex-column">
          <h2 className="myTextBlu fw-bolder"> Silv</h2>
          <p className="px-5 mx-5 myTextWhite ">
            Lorem ipsum dolor sit amet consectetur adipisicing elit.
            Perspiciatis ea architecto odio omnis quibusdam nulla dolor
            dignissimos similique deleniti, quam illum earum obcaecati eveniet,
            temporibus rerum modi ratione, commodi praesentium!
          </p>
        </Col>
        <Col className=" d-flex align-items-center justify-content-center   flex-m-flex ">
          <img src={smart1} alt="" className="vert-move" />
          <img src={smart2} alt="" className=" vert-move2" />
        </Col>
      </Row>
      <Row className="d-flex  align-items-center ">
        <img src={pc1} alt="" />
      </Row>
    </>
  );
}

export default SilvProject;
